func TestQuadraticArith(t *testing.T) {
	for i, sampleInput := range sampleQuadraticIns {
		inputs := strings.Split(sampleInput, ",")
		results := strings.Split(sampleQuadraticOuts[i], ",")

		aXVal, err := fromBase64Str(inputs[0])
		assert.NoError(t, err)
		aYVal, err := fromBase64Str(inputs[1])
		assert.NoError(t, err)
		bXVal, err := fromBase64Str(inputs[2])
		assert.NoError(t, err)
		bYVal, err := fromBase64Str(inputs[3])
		assert.NoError(t, err)
		nVal, err := fromBase64Str(inputs[4])
		assert.NoError(t, err)

		a := newQuadE()
		a.x.setBytes(aXVal)
		a.y.setBytes(aYVal)
		b := newQuadE()
		b.x.setBytes(bXVal)
		b.y.setBytes(bYVal)
		n := new(big.Int).SetBytes(nVal)

		inv := newQuadE().inv(a)
		assert.True(t, strings.Compare(toBase64Str(inv.bytes()), results[0]) == 0)

		inv.inv(inv)
		assert.True(t, strings.Compare(toBase64Str(inv.bytes()), results[1]) == 0)

		prd := newQuadE().mul(a, b)
		assert.True(t, strings.Compare(toBase64Str(prd.bytes()), results[2]) == 0)

		prd.mul(prd, b)
		assert.True(t, strings.Compare(toBase64Str(prd.bytes()), results[3]) == 0)

		sqr := newQuadE().sqr(a)
		assert.True(t, strings.Compare(toBase64Str(sqr.bytes()), results[4]) == 0)

		sqr.sqr(sqr)
		assert.True(t, strings.Compare(toBase64Str(sqr.bytes()), results[5]) == 0)

		pow := newQuadE().powN(b, n)
		assert.True(t, strings.Compare(toBase64Str(pow.bytes()), results[6]) == 0)

		cofac, done := new(big.Int).SetString("12016012264891146079388821366740534204802954401251311822919615131047207289359704531102844802183906537786776", 10)
		assert.True(t, done)
		out := newQuadE()
		calcTateExp(out, a, newQuadE(), cofac)
		assert.True(t, strings.Compare(toBase64Str(out.bytes()), results[7]) == 0)
	}
}
